import pandas as pd
import plotly
from fbprophet import Prophet
import plotly.express as px
import matplotlib.pyplot as plt

import plotly.io as pio
pio.renderers.default = 'colab'

df = pd.read_csv("/content/TSLA.csv")
df

df.info()

df.describe()

"""252 trading days

Median Price - $ 694.890015

Close Price is most accurate representation

# Data Visualization
"""

px.area(df,x = "Date", y = "Close")

px.line(df,x = "Date", y = "Close")

"""### Analyse Volumn"""

px.area(df,x = "Date", y = "Volume")

px.bar(df,x = "Date", y = "Volume")

px.box(df, y = "Close")

"""## Facebook Prophet

![image.png](data:image/png;base64,)
"""

new_df = pd.DataFrame(df,columns= ["Date","Close"])
new_df

"""Facebook Prophet does not understand data and close, it only understands ds and y"""

new_df = new_df.rename(columns={'Date' : 'ds','Close':'y'})
new_df

"""## Creating Facebook Prohet Model"""

model = Prophet()
model.fit(new_df)

"""## Forecasting"""

future = model.make_future_dataframe(periods=30)
forecast = model.predict(future)
forecast

px.line(forecast,x ='ds',y='yhat')

figure = model.plot(forecast, xlabel='ds', ylabel='y')

figure2 = model.plot_components(forecast)

"""### Downloading the Forecast data"""

from google.colab import files
forecast.to_csv('forecast.csv')
files.download('forecast.csv')